import React, { useState } from "react";

export function getData() {
  const urlMetal =
    "https://metals-api.com/api/latest?access_key=qba30a3bp2c9dl6oupq250f11my19te3u5fkbd6jk807o831mnb1g1o5jaiz&base=EUR&symbols=XAG";
  const urlSek = "https://api.exchangeratesapi.io/latest?base=EUR";
  const data = [(metal = 0), (sek = 0)];

  /* 
    const response = await fetch(urlMetal);

    if (response.ok) {
     
        var dataRes = await response.json();   
        data.metal.setData(dataRes.rates.XAG);
    }

    const responseSEK = await fetch(data.urlSek);

      if (responseSEK.ok) {
        var dataResSEK = await responseSEK.json();
        data.sek.setData(dataResSEK.rates.SEK);
      } */

  data.metal = 20;
  data.sek = 15;
  return data;
}
